import { ListOfReposContainer , Repo} from "../reposContainer/styles"
import { Section, UserAvatar, UserLogin } from "./styles"



function UserFollowers  (props)  {


    return (
        <Section>
                <UserLogin>Followers de {(props?.name)} </UserLogin>
                    <ListOfReposContainer>
                    
                                {(props?.followers).map(follo => (
                                    <UserAvatar key={follo?.id}>
                                            <img src={follo.avatar_url} alt="" />
                                    </UserAvatar>
                                ))}

                        </ListOfReposContainer>
                
        </Section>
    )
}

export default UserFollowers
